import React from 'react';
import ReactDOM from 'react-dom';
import Button from '@material-ui/core/Button';

function App() {
  return (
    <Button variant="contained" color="primary">
      Hello World
    </Button>
  );
}
const Index = () => (
    <div>
    <Button variant="contained" color="primary">
      Hello World
    </Button>
    </div>
  );
export default Index;
